До параметрів дії належать:
	1) масштабування експортованих зображень по центру або на весь слайд Keynote;
	2) можливість створення й використання нового документа Keynote замість будь-якого наявного;
	3) можливість використання описів медіафайлів як приміток доповідача;
	4) можливість запустити відтворення презентації Keynote.

I parametri di azione includono:
	1) ridimensionamento delle immagini esportate per centrare o adattarsi alle diapositive Keynote;
	2) possibilità di creare e usare un nuovo documento Keynote anziché un documento esistente;
	3) possibilità di utilizzare descrizioni di elementi multimediali come note presentatore diapositiva;
	4) possibilità di avviare la riproduzione della presentazione Keynote.
